        <>
            <div class="container" id="AptCajaContainer">
                <br />
                <h1>Apertura de Caja</h1>
                <div class="container">
                    <div class="row">
                        <div class="col-sm">
                            <img src="https://d1nhio0ox7pgb.cloudfront.net/_img/g_collection_png/standard/512x512/wallet.png" id="aptCajaLogo" />
                        </div>
                        <div class="col-sm">
                            <div class="row">
                                <div class="col-5">
                                    <h5>Restaurante</h5>
                                </div>
                                <div class="col-sm">
                                    <h5>Monto Apertuta</h5>
                                </div>
                            </div>
                            <div class="row">
                                <div class="col-5">
                                    <input type="text" class="form-control" name='Restaurante' />
                                </div>
                                <div class="col-sm">
                                    <input type="text" class="form-control" name='Monto'/>
                                </div>
                            </div>
                            <br />
                            <div class="row">
                                <div class="col-sm">
                                    <button type="button" onClick={getRestaurante}>Submit</button>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}
